  \"\",\n\t\t\"description\": \"A map service on the www depicting the locations of
  activities within the Silviculture Timberstand Improvement Program. This map service
  portrays the area where activities accomplished as a part of the silviculture program
  of work, funded through the budget allocation process and reported through the Forest
  Service Activity Tracking System (FACTS) database and are part of the Performance
  Measures used to rate Agency performance in meeting the Departmentu2019s Strategic
  Goals. It is important to note that this map service may not contain all accomplished
  activities; the spatial portion of the activity description is not currently enforced
  by FACTS and at this time some are optionally reported by Forest Service units.
  This map service only represents those activities associated with the performance
  measure Forest Vegetation Improved (Release, Weeding, and Cleaning, Precommercial
  Thinning, Pruning and Fertilization). As spatial data reporting is enforced by the
  application and acceptance of reporting increases for both tabular and spatial we
  hope to improve the quality and comprehensiveness of the data used for this layer
  in coming years.\",\n\t\t\"format\": \"ArcGIS Map Service\",\n\t\t\"tracking_summary\":
